      email: 'admin@gmail.com',
      password: bcrypt.hashSync('parola'),
      isAdmin: true,
    },
    {
      name: 'Maria',
      email: 'maria@example.com',
      password: bcrypt.hashSync('maria'),
      isAdmin: false,
    },
  ],
  pets: [
    {
      name: 'Thomas',
      slug: 'thomas',
      breed: 'cat',
      age: 3,
      gender: 'Masculin',
      description: 'Foarte iubitor',
